	public static void ingresarClaveWeb(String claveWeb) throws Exception {
		WebElement contenedor = EFA.cv_driver.findElementByXPath("//*[@id='app']/div[2]/div/div[4]/div");
		List<WebElement> listaElementos = contenedor.findElements(By.xpath(".//*[name()='path' or name()='polygon']"));
		
		HashMap<String, String> listaRutas = new HashMap<String, String>();		
		for (int i = 0; i < listaElementos.size(); i++) {
			String indiceRuta = "";
			indiceRuta = listaElementos.get(i).getAttribute("d");
			if (indiceRuta == null) {
				indiceRuta = "";
			} 
			if (indiceRuta.equals("")) {
				indiceRuta = listaElementos.get(i).getAttribute("points");
			}
			listaRutas.put(indiceRuta, String.valueOf(i+1));
		}
		
		for (int i = 0; i < claveWeb.length(); i++) {
			String indiceClaveWeb = "";
			indiceClaveWeb = String.valueOf(claveWeb.charAt(i));
			String indiceTecla = tecladoVirtual().get(indiceClaveWeb);
			
			String indice = listaRutas.get(indiceTecla);
			String valorXpath = "//*[@id='app']/div[2]/div/div[4]/div/a["+indice+"]";			
			Element posicion = new Element("xpath", valorXpath);
			EFA.executeAction(Action.Click, posicion);
		}
	}
